 production by inhibition of IL - 1beta converting enzyme ( ICE , caspase - 1 ) is one promising strategy because of the key roles of these cytokines in many inflammatory diseases .

<div class="entities" style="line-height: 2.5; direction: ltr">In situ generation of nitric oxide by myenteric neurons but not by mononuclear cells of the human colon . 1 . Production of nitric oxide ( NO ) is implicated in the pathogenesis of inflammatory bowel disease . However , the cells responsible for the production of NO in situ in the human colon remain unknown . 2 . Surgical samples from 12 patients with ulcerative colitis , eight patients with Crohn ' s disease and 10 controls were studied . Possible generation of NO was visualized by reduced nicotinamide adenine dinucleotide phosphate ( NADPH ) diaphorase activity in human colon . Immunohistological staining for various NO synthase ( NOS ) isoforms ( endothelial , neuronal and inducible ) , nitrotyrosine and interleukin - 2 was also performed . 3 . Reduced NADPH diaphorase activity was not found in lamina propria mononuclear cells , but was found in colonic epithelium , endothelium and myenteric neurons and their processes . 4 . The NADPH-diaphorase activity positive processes were significantly less common in colon from patients with Crohn ' s disease compared with control colon . 5 .

<div class="entities" style="line-height: 2.5; direction: ltr">IL - 20 activates human lymphatic endothelial cells causing cell signalling and tube formation . IL - 20 is an arteriogenic cytokine that remodels collateral networks in vivo , and plays a role in cellular organization . Here , we investigate its role in lymphangiogenesis using a lymphatic endothelial cell line , hTERT-HDLEC , which expresses the lymphatic markers

</mark>
 and podoplanin . Upon stimulation of hTERT-HDLEC with IL - 20 , we found an increase in the intracellular free calcium concentration , in Akt and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474

</mark>
 phosphorylations as well as in perinuclear NO production . We found that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474

</mark>
 phosphorylation and NO synthesis are highly dependent on the PI3K / Akt signalling pathway . We also found an IL - 20 induced phosphorylation of Erk 1/2 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42345

</mark>
 , and using the MEK inhibitor PD98059 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 complex inhibitor rapamycin we demonstrated the importance of these signalling pathways in IL - 20 - mediated proliferation . IL - 20 triggered actin polymerization and morphological changes resulting in elongated cell structures , and in matrigels , IL - 20 caused tube formations of hTERT-HDLEC in a PI3K - and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 dependent way . In a sprouting assay we found that IL - 20 caused cell migration within 24 h at a rate comparable to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , and this migration could be inhibited by wortmannin and rapamycin . These data show that IL - 20 activates cell signalling resulting in lymphangiogenic processes including migration , proliferation and tube formation . Thus , IL - 20 is a cytokine that has the potential of activating or modulating the formation of lymphatic vessels .</div>

<h2 style="margin: 0">7</h2>

 ( CysLT 1 receptor ) antagonists were found to inhibit chloride secretion in human airway epithelial cells . Since chloride secretion in renal epithelial cells , which shares common mechanisms with airway epithelial cells , plays important roles in renal cyst progression in polycystic kidney disease (

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 protein expression . Interestingly , pranlukast enhanced AMPK activation via calcium / calmodulin-dependent protein kinase kinase beta ( CaMKK ) with consequent activation of acetyl - DB01992 carboxylase ( ACC ) and suppression of mammalian target of rapamycin ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) pathway . These results indicate that pranlukast retards renal epithelial cyst progression by inhibiting DB02527 - activated chloride secretion and cell proliferation via CaMKK-AMPK - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 pathway . Therefore , pranlukast represents a class of known drugs that may have potential utility in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Determination of fenofibric acid concentrations by HPLC after anion exchange solid-phase extraction from human serum . Triglycerides are increasingly being recognized as a risk factor for cardiovascular disease . Research efforts to identify sources of variability in triglyceride-lowering response to the lipid-lowering drug fenofibrate require quantification of the active acidic form of this 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 agonist . Anion-exchange solid-phase extraction , in combination with reverse-phase high-performance liquid chromatography ( HPLC ) , rapidly and accurately determines steady-state fenofibric acid serum concentrations . Chromatographic separation under isocratic conditions , with use of ultraviolet detection at 285 nm , provides clean baseline and sharp peaks for clofibric acid , 1 - napthyl acetic acid ( internal standards ) , and fenofibric acid . Commonly prescribed and over-the-counter nonsteroidal anti-inflammatory drugs ( NSAIDs ) were screened for assay interference , and the assay was employed to quantify fenofibric acid in more than 800 human subject specimens .

 analysis was found to be linear over the range of 0.5 to 40 mg / L and was validated with either internal standard . Accuracies ranged from 98.65 % to 102.4 % , whereas the within - and between-day precisions ranged from 1.0 % to 2.2 % and 2.0 % to 6.2 % , respectively . NSAIDs had minimal interference with the assay , which succeeded in quantifying fenofibric acid in more than 843 of 846 serum samples from human subjects , many taking a variety of coadministered medications . Anion-exchange solid-phase extraction in combination with reverse-phase HPLC accurately determines steady-state fenofibric acid serum concentrations in humans without interference from NSAIDs or commonly administered medications . This method is suitable for quantification of fenofibric acid for clinical pharmacokinetic studies in patients with dyslipidemia .</div>

<h2 style="margin: 0">17</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Inhibition of prothrombin kringle - 2 - induced inflammation by minocycline protects dopaminergic neurons in the substantia nigra in vivo . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 kringle - 2 ( pKr - 2 ) , a domain of prothrombin , can cause the degeneration of mesencephalic dopaminergic neurons through microglial activation . However , the chemical products that inhibit pKr - 2 - induced inflammatory activities in the brain are still not well known . The present study investigated whether minocycline , a semisynthetic tetracycline derivative , could inhibit pKr - 2 - induced microglial activation and prevent the loss of nigral dopaminergic ( DA ) neurons in vivo . To address this question , rats were administered a unilateral injection of pKr - 2 in the substantia nigra in the presence or absence of minocycline . Our results show that pKr - 2 induces the production of proinflammatory cytokines , such as tumor necrosis factor- ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 -  ) and interleukin - 1 ( IL - 1 ) , and inducible nitric oxide synthase from the activated microglia . In parallel , 7 days after pKr - 2 injection , tyrosine hydroxylase immunocytochemical analysis and western blot analysis showed a significant loss of nigral DA neurons . This neurotoxicity was antagonized by minocycline and the observed neuroprotective effects were associated with the ability of minocycline to suppress the expression of tumor necrosis factor- , interleukin - 1 , and nitric oxide synthase . These results suggest that minocycline may be promising as a potential therapeutic agent for the prevention of DA neuronal degeneration associated with pKr - 2 - induced microglial activation .</div>
